lens_2.query:
q = load "${App.Datasets.Demo_Account_Metrics.FullyQualifiedName}";
q_A = filter q by date('Date_Year', 'Date_Month', 'Date_Day') in ["current year".."current year"];
q_A = foreach q_A generate 'Account_Name', {{row(static_1.selection, [0], ["Field_value","Alias_name"]).asProjection()}};
q_B = filter q by date('Date_Year', 'Date_Month', 'Date_Day') in ["1 year ago".."1 year ago"];
q_B = foreach q_B generate 'Account_Name', {{row(static_1.selection, [0], ["Field_value","Alias_name"]).asProjection()}};
q = cogroup q_A by 'Account_Name', q_B by 'Account_Name';
q = foreach q generate coalesce(q_A.'Account_Name', q_B.'Account_Name') as 'Account_Name', {{cell(static_1.selection, 0, "AggFunction").asString()}}(q_A.'{{cell(static_1.selection, 0, "Alias_name").asString()}}') as 'A', {{cell(static_1.selection, 0, "AggFunction").asString()}}(q_B.'{{cell(static_1.selection, 0, "Alias_name").asString()}}') as 'B';
q = foreach q generate 'Account_Name', A-B as '{{cell(static_1.selection, 0, "Alias_decline").asString()}}', (A - B)/B as '{{cell(static_1.selection, 0, "Alias_decline_percent").asString()}}';
q = order q by '{{cell(static_1.selection, 0, "Alias_decline").asString()}}' asc;
q = limit q 2000;
